import { useContext, useEffect, useState } from "react";
import { Context } from "./Context";

function UserLogin() {

    const [user, setUser] = useState("Guest");
    const openForm = useContext(Context);
    const [form, setOpenForm] = useState(openForm);


    return (
        <>
            <div className="sidenavlogin">
                <p>Hi {user}!</p>
                <p>Welcome to Access Workspace</p>
                <p><button onClick={() => { setOpenForm({ form: true }); console.log(form); }}>Login</button></p>
            </div>
        </>
    );
}

export default UserLogin;
